import Post from "../post/Post";
import "./posts.css";

export default function Posts({ posts }) {
  renderPosts()
  {
    posts.map((p) => (
      <Post post={p} />
    ))
  }
  return (
    <div className="posts">
     {renderPosts()}
    </div>
  );
}
